objetoCompra:
Contratação, de forma exclusiva, de solução tecnológica denominada Sistema Web de Gestão Tributária, 
com licenciamento de uso por 12 (doze) meses, contemplando: 
a) acesso para até 12 (doze) usuários; 
b) simulador automático de retenções tributárias aplicáveis aos pagamentos da CÂMARA DE SALVADOR 
(INSS, IRRF, e ISS); 
c) consulta de legislação tributária por município; 
d) 10 (dez) Informações Fiscais – IFs para consultoria técnica especializada; 
e) geração de relatórios e orientação em PDF;
